class Solution(object):
    def canSplitArray(self, nums, m):
        """
        :type nums: List[int]
        :type m: int
        :rtype: bool
        """
        def dfs(nums, m, start, subarrays):
            if start == len(nums):
                return subarrays == 0
            cur_sum = 0
            for i in range(start, len(nums)):
                cur_sum += nums[i]
                if cur_sum >= m and dfs(nums, m, i + 1, subarrays - 1):
                    return True
            return False

        total_sum = sum(nums)
        if total_sum < m * (len(nums) - 1):
            return False
        return dfs(nums, m, 0, len(nums))
